        <ul id="task-list" tabindex="0"></ul>
        <p>Total tasks: <span id="total-tasks">0</span></p>
        <p>Completed tasks: <span id="completed-tasks">0</span></p>
    </div>

    <div class="column">
        <div id="timer">
            <h2>Focus Timer</h2>
            <div id="timer-display" aria-live="polite">25:00</div>
            <button id="start-pause" aria-label="Start Timer">Start</button>
            <button id="reset" aria-label="Reset Timer">Reset</button>
            <p id="timer-mode">Focus</p>
        </div>
    </div>

    <script>
        const newTaskInput = document.getElementById('new-task');
        const addTaskButton = document.getElementById('add-task');
        const taskList = document.getElementById('task-list');
        const totalTasksSpan = document.getElementById('total-tasks');
        const completedTasksSpan = document.getElementById('completed-tasks');

        const timerDisplay = document.getElementById('timer-display');
        const startPauseButton = document.getElementById('start-pause');
        const resetButton = document.getElementById('reset');
        const timerModeDisplay = document.getElementById('timer-mode');

        let tasks = JSON.parse(localStorage.getItem('tasks')) || [];
        let timerRunning = localStorage.getItem('timerRunning') === 'true' || false;
        let timerInterval;
        let timeLeft = parseInt(localStorage.getItem('timeLeft')) || 25 * 60;
        let timerMode = localStorage.getItem('timerMode') || 'focus'; // 'focus' or 'break'
        let focusTime = 25 * 60;
        let breakTime = 5 * 60;
        let timerStartTime = localStorage.getItem('timerStartTime') ? parseInt(localStorage.getItem('timerStartTime')) : null;
        let selectedTaskIndex = null;

        function updateTaskCounts() {
            totalTasksSpan.textContent = tasks.length;
            completedTasksSpan.textContent = tasks.filter(task => task.completed).length;
        }

        function renderTasks() {
            taskList.innerHTML = '';
            tasks.forEach((task, index) => {
                const li = document.createElement('li');
                li.textContent = task.text;
                li.tabIndex = 0;

                if (task.completed) {
                    li.classList.add('completed');
                }

                if (selectedTaskIndex === index) {
                    li.classList.add('selected');
                }

                li.addEventListener('click', () => {
                    selectedTaskIndex = index;
                    renderTasks();
                });

                li.addEventListener('focus', () => {
                    selectedTaskIndex = index;
                    renderTasks();
                });

                const completeButton = document.createElement('button');
                completeButton.textContent = task.completed ? 'Undo' : 'Complete';
                completeButton.setAttribute('aria-label', task.completed ? 'Mark task as incomplete' : 'Mark task as complete');
                completeButton.addEventListener('click', (event) => {
                    event.stopPropagation();
                    tasks[index].completed = !tasks[index].completed;
                    saveTasks();
                    renderTasks();
                    updateTaskCounts();
                });

                const deleteButton = document.createElement('button');
                deleteButton.textContent = 'Delete';
                deleteButton.setAttribute('aria-label', 'Delete task');
                deleteButton.addEventListener('click', (event) => {
                    event.stopPropagation();
                    tasks.splice(index, 1);
                    saveTasks();
                    renderTasks();
                    updateTaskCounts();
                    selectedTaskIndex = null;
                });

                li.appendChild(completeButton);
                li.appendChild(deleteButton);
                taskList.appendChild(li);
            });
        }

        function addTask() {
            const text = newTaskInput.value.trim();
            if (text !== '') {
                tasks.push({ text: text, completed: false });
                newTaskInput.value = '';
                saveTasks();
                renderTasks();
                updateTaskCounts();
            }
        }

        function saveTasks() {
            localStorage.setItem('tasks', JSON.stringify(tasks));
        }

        addTaskButton.addEventListener('click', addTask);
        newTaskInput.addEventListener('keydown', (event) => {
            if (event.key === 'Enter') {
                addTask();
            }
        });

        taskList.addEventListener('keydown', (event) => {
            if (event.key === 'Delete' && selectedTaskIndex !== null) {
                tasks.splice(selectedTaskIndex, 1);
                saveTasks();
                renderTasks();
                updateTaskCounts();
                selectedTaskIndex = null;
            }
        });

        function updateTimerDisplay() {
            const minutes = Math.floor(timeLeft / 60);
            const seconds = timeLeft % 60;
            timerDisplay.textContent = `${String(minutes).padStart(2, '0')}:${String(seconds).padStart(2, '0')}`;
        }

        function startPauseTimer() {
            if (timerRunning) {
                clearInterval(timerInterval);
                startPauseButton.textContent = 'Start';
                startPauseButton.setAttribute('aria-label', 'Start Timer');
                localStorage.setItem('timerRunning', 'false');
                timerStartTime = null;
                localStorage.removeItem('timerStartTime');

            } else {
                timerStartTime = Date.now();
                localStorage.setItem('timerStartTime', timerStartTime.toString());

                timerInterval = setInterval(() => {
                    const now = Date.now();
                    const elapsed = Math.floor((now - timerStartTime) / 1000);
                    timeLeft = Math.max(0, (timerMode === 'focus' ? focusTime : breakTime) - elapsed);

                    updateTimerDisplay();
                    localStorage.setItem('timeLeft', timeLeft.toString());

                    if (timeLeft <= 0) {
                        clearInterval(timerInterval);
                        timerRunning = false;
                        localStorage.setItem('timerRunning', 'false');
                        timerStartTime = null;
                        localStorage.removeItem('timerStartTime');

                        if (timerMode === 'focus') {
                            timerMode = 'break';
                            timeLeft = breakTime;
                            timerModeDisplay.textContent = 'Break';
                        } else {
                            timerMode = 'focus';
                            timeLeft = focusTime;
                            timerModeDisplay.textContent = 'Focus';
                        }
                        localStorage.setItem('timerMode', timerMode);
                        updateTimerDisplay();
                        startPauseButton.textContent = 'Start';
                        startPauseButton.setAttribute('aria-label', 'Start Timer');
                        startPauseTimer(); // Auto start next interval
                    }
                }, 1000);
                startPauseButton.textContent = 'Pause';
                startPauseButton.setAttribute('aria-label', 'Pause Timer');
                localStorage.setItem('timerRunning', 'true');
            }
            timerRunning = !timerRunning;
        }

        function resetTimer() {
            clearInterval(timerInterval);
            timerRunning = false;
            localStorage.setItem('timerRunning', 'false');
            timerStartTime = null;
            localStorage.removeItem('timerStartTime');

            timeLeft = timerMode === 'focus' ? focusTime : breakTime;
            updateTimerDisplay();
            startPauseButton.textContent = 'Start';
            startPauseButton.setAttribute('aria-label', 'Start Timer');
            localStorage.setItem('timeLeft', timeLeft.toString());
            localStorage.setItem('timerMode', timerMode);
        }

        startPauseButton.addEventListener('click', startPauseTimer);
        resetButton.addEventListener('click', resetTimer);

        document.addEventListener('keydown', (event) => {
            if (document.activeElement === newTaskInput || document.activeElement === addTaskButton) return;

            if (event.key === ' ' && document.activeElement !== startPauseButton && document.activeElement !== resetButton) {
                startPauseTimer();
                event.preventDefault(); // Prevent scrolling
            }
        });

        function initTimer() {
            timerMode = localStorage.getItem('timerMode') || 'focus';
            timerModeDisplay.textContent = timerMode === 'focus' ? 'Focus' : 'Break';

            if (timerRunning) {
                timerStartTime = parseInt(localStorage.getItem('timerStartTime'));
                if (timerStartTime) {
                    const now = Date.now();
                    const elapsed = Math.floor((now - timerStartTime) / 1000);
                    timeLeft = Math.max(0, (timerMode === 'focus' ? focusTime : breakTime) - elapsed);

                    if (timeLeft <= 0) {
                        timerMode = timerMode === 'focus' ? 'break' : 'focus';
                        timeLeft = timerMode === 'focus' ? focusTime : breakTime;
                        localStorage.setItem('timerMode', timerMode);
                        timerModeDisplay.textContent = timerMode === 'focus' ? 'Focus' : 'Break';
                        timerRunning = false;
                        localStorage.setItem('timerRunning', 'false');
                        startPauseButton.textContent = 'Start';
                        startPauseButton.setAttribute('aria-label', 'Start Timer');
                    } else {
                        startPauseTimer();
                    }
                } else {
                    timerRunning = false;
                    localStorage.setItem('timerRunning', 'false');
                    startPauseButton.textContent = 'Start';
                    startPauseButton.setAttribute('aria-label', 'Start Timer');
                }
            }

            updateTimerDisplay();
            if(timerRunning){
                startPauseButton.textContent = 'Pause';
                startPauseButton.setAttribute('aria-label', 'Pause Timer');
            }
            else{
                startPauseButton.textContent = 'Start';
                startPauseButton.setAttribute('aria-label', 'Start Timer');
            }
        }

        renderTasks();
        updateTaskCounts();
        initTimer();
    </script>

</body>
</html>
