        const completedTasksDisplay = document.getElementById('completed-tasks');

        const timeDisplay = document.getElementById('time-display');
        const startPauseButton = document.getElementById('start-pause');
        const resetButton = document.getElementById('reset');
        const timerModeDisplay = document.getElementById('timer-mode');

        let tasks = JSON.parse(localStorage.getItem('tasks')) || [];
        let timerRunning = localStorage.getItem('timerRunning') === 'true' || false;
        let timeLeft = parseInt(localStorage.getItem('timeLeft')) || 25 * 60;
        let timerInterval;
        let timerMode = localStorage.getItem('timerMode') || 'focus'; // 'focus' or 'break'
        let focusTime = parseInt(localStorage.getItem('focusTime')) || 25 * 60;
        let breakTime = parseInt(localStorage.getItem('breakTime')) || 5 * 60;
        let selectedTaskIndex = null;

        function updateTaskCounts() {
            totalTasksDisplay.textContent = tasks.length;
            completedTasksDisplay.textContent = tasks.filter(task => task.completed).length;
        }

        function renderTasks() {
            taskList.innerHTML = '';
            tasks.forEach((task, index) => {
                const li = document.createElement('li');
                li.textContent = task.text;
                li.dataset.index = index;
                li.tabIndex = 0;

                if (task.completed) {
                    li.classList.add('completed');
