                const completeButton = document.createElement('button');
                completeButton.textContent = task.completed ? 'Uncomplete' : 'Complete';
                completeButton.setAttribute('aria-label', task.completed ? 'Mark task as uncomplete' : 'Mark task as complete');
                completeButton.type = "button";
                completeButton.addEventListener('click', (event) => {
                    event.stopPropagation(); // Prevent li click
                    toggleComplete(index);
                });
                li.appendChild(completeButton);

                const deleteButton = document.createElement('button');
                deleteButton.textContent = 'Delete';
                deleteButton.setAttribute('aria-label', 'Delete task');
                deleteButton.type = "button";
                deleteButton.addEventListener('click', (event) => {
                    event.stopPropagation(); // Prevent li click
                    deleteTask(index);
                });
                li.appendChild(deleteButton);

                li.addEventListener('click', () => {
                    selectedTaskIndex = index;
                    Array.from(taskList.children).forEach(child => child.style.outline = 'none');
                    li.style.outline = '2px solid blue';
                    li.focus();
                });

                li.addEventListener('focus', () => {
                    selectedTaskIndex = index;
                    Array.from(taskList.children).forEach(child => child.style.outline = 'none');
                    li.style.outline = '2px solid blue';
                });

                taskList.appendChild(li);
            });
            updateTaskCounts();
        }

        function addTask() {
            const text = taskInput.value.trim();
            if (text !== '') {
                tasks.push({ text: text, completed: false });
                taskInput.value = '';
                saveTasks();
                renderTasks();
            }
        }

        function toggleComplete(index) {
            tasks[index].completed = !tasks[index].completed;
            saveTasks();
            renderTasks();
        }

        function deleteTask(index) {
            tasks.splice(index, 1);
            saveTasks();
            renderTasks();
        }

