            timerInterval = setInterval(() => {
                timeLeft--;
                updateTimeDisplay();
                localStorage.setItem('timeLeft', timeLeft);

                if (timeLeft < 0) {
                    clearInterval(timerInterval);
                    timerRunning = false;
                    localStorage.setItem('timerRunning', 'false');
                    if (timerMode === 'focus') {
                        timerMode = 'break';
                        timeLeft = breakTime;
                        timerModeDisplay.textContent = 'Break';
                    } else {
                        timerMode = 'focus';
                        timeLeft = focusTime;
                        timerModeDisplay.textContent = 'Focus';
                    }
                    localStorage.setItem('timerMode', timerMode);
                    localStorage.setItem('timeLeft', timeLeft);
                    timerModeDisplay.textContent = timerMode.charAt(0).toUpperCase() + timerMode.slice(1);
                    startTimer();
                }
            }, 1000);
        }

        function pauseTimer() {
            timerRunning = false;
            clearInterval(timerInterval);
            startPauseButton.textContent = 'Start';
            startPauseButton.setAttribute('aria-label', 'Start Timer');
            localStorage.setItem('timerRunning', 'false');
        }

        function resetTimer() {
            pauseTimer();
            timerMode = localStorage.getItem('timerMode') || 'focus';
            if (timerMode === 'focus') {
                timeLeft = focusTime;
            } else {
                timeLeft = breakTime;
            }
            updateTimeDisplay();
            localStorage.setItem('timeLeft', timeLeft);
        }

        function toggleTimer() {
            if (timerRunning) {
                pauseTimer();
            } else {
                startTimer();
            }
        }

        addTaskButton.addEventListener('click', addTask);
        startPauseButton.addEventListener('click', toggleTimer);
        resetButton.addEventListener('click', resetTimer);

        taskInput.addEventListener('keydown', (event) => {
            if (event.key === 'Enter') {
                addTask();
            }
        });

        document.addEventListener('keydown', (event) => {
            if (event.code === 'Space' && document.activeElement.tagName !== 'INPUT') {
                event.preventDefault(); // Prevent scrolling
                toggleTimer();
            }
            if (event.code === 'Delete') {
                if (selectedTaskIndex !== null) {
                    deleteTask(selectedTaskIndex);
                    selectedTaskIndex = null;
                }
            }
        });

        // Initialization
        timerModeDisplay.textContent = timerMode.charAt(0).toUpperCase() + timerMode.slice(1);
        updateTimeDisplay();
        renderTasks();

        if (timerRunning) {
            startTimer();
        }
    </script>

</body>
</html>
