<!DOCTYPE html>
<html lang="en">
<head>
<meta charset="UTF-8">
<meta name="viewport" content="width=device-width, initial-scale=1.0">
<title>Focus Board</title>
<style>
  body { font-family: Arial, sans-serif; }
  .container { display: flex; justify-content: space-between; width: 80%; margin: auto; }
  .task-list { width: 45%; }
  .timer { width: 45%; text-align: center; }
  .task-input { width: calc(100% - 2px); padding: 5px; margin-bottom: 10px; }
  .task-item { display: flex; justify-content: space-between; align-items: center; margin-bottom: 5px; }
  .task-btn { background-color: #f44336; color: white; border: none; padding: 5px 10px; cursor: pointer; }
  .timer-btn { background-color: #2196F3; color: white; border: none; padding: 10px 20px; margin: 10px; cursor: pointer; }
</style>
</head>
<body>
<div class="container">
  <div class="task-list">
    <input type="text" id="task-input" placeholder="Add task..." aria-label="Task input">
    <button onclick="addTask()" aria-label="Add task">Enter</button>
    <ul id="task-list"></ul>
    <p>Total: <span id="total-tasks">0</span>, Done: <span id="done-tasks">0</span></p>
  </div>
  <div class="timer">
    <h2>Focus Timer</h2>
    <button onclick="startTimer()" aria-label="Start timer">Start</button>
    <button onclick="pauseTimer()" aria-label="Pause timer">Pause</button>
    <button onclick="resetTimer()" aria-label="Reset timer">Reset</button>
    <p id="timer">25:00</p>
  </div>
</div>

<script>
  let tasks = JSON.parse(localStorage.getItem('tasks')) || [];
  let timerInterval;
  let isPaused = false;

  function renderTasks() {
    const taskList = document.getElementById('task-list');
    taskList.innerHTML = '';
    tasks.forEach((task, index) => {
      const li = document.createElement('li');
      li.className = 'task-item';
      li.innerHTML = `
        <span>${task}</span>
        <button onclick="completeTask(${index})" aria-label="Complete task">Done</button>
        <button onclick="deleteTask(${index})" aria-label="Delete task">Delete</button>
      `;
      taskList.appendChild(li);
    });
    document.getElementById('total-tasks').textContent = tasks.length;
    document.getElementById('done-tasks').textContent = tasks.filter(t => t.done).length;
  }

  function addTask() {
    const input = document.getElementById('task-input');
    if (input.value.trim()) {
      tasks.push({ text: input.value, done: false });
      localStorage.setItem('tasks', JSON.stringify(tasks));
      renderTasks();
      input.value = '';
    }
  }

  function completeTask(index) {
    tasks[index].done = !tasks[index].done;
    localStorage.setItem('tasks', JSON.stringify(tasks));
    renderTasks();
  }

  function deleteTask(index) {
    tasks.splice(index, 1);
    localStorage.setItem('tasks', JSON.stringify(tasks));
    renderTasks();
  }

  function startTimer() {
    if (timerInterval) return;
    let time = 25 * 60;
    const timerDisplay = document.getElementById('timer');
    isPaused = false;

    function updateTimer() {
      const minutes = Math.floor(time / 60);
      const seconds = time % 60;
      timerDisplay.textContent = `${minutes.toString().padStart(2, '0')}:${seconds.toString().padStart(2, '0')}`;
      if (time <= 0) {
        clearInterval(timerInterval);
        alert('Break Time!');
        startTimer();
      } else {
        time--;
      }
    }

    timerInterval = setInterval(updateTimer, 1000);
  }

  function pauseTimer() {
    isPaused = true;
    clearInterval(timerInterval);
  }

  function resetTimer() {
    clearInterval(timerInterval);
    isPaused = false;
    document.getElementById('timer').textContent = '25:00';
  }

  renderTasks();
</script>
</body>
</html>
