        function loadState() {
            const savedTasks = localStorage.getItem('tasks');
            const savedTimer = localStorage.getItem('timerState');

            if (savedTasks) tasks = JSON.parse(savedTasks);
            if (savedTimer) {
                const storedTimer = JSON.parse(savedTimer);
                const elapsedTime = Date.now() - storedTimer.startTime;

                timer = {
                    ...timer,
                    ...storedTimer,
                    interval: null,
                    isRunning: false
                };

                if (storedTimer.isRunning) {
                    const totalSeconds = timer.minutes * 60 + timer.seconds;
                    const remainingSeconds = Math.max(0, totalSeconds - Math.floor(elapsedTime / 1000));

                    timer.minutes = Math.floor(remainingSeconds / 60);
                    timer.seconds = remainingSeconds % 60;

                    if (remainingSeconds > 0) {
                        startTimer();
                    }
                }
            }

            renderTasks();
            updateTimerDisplay();
            updateTaskCounts();
