        function resetTimer() {
            clearInterval(timer.interval);
            timer.minutes = 25;
            timer.seconds = 0;
            timer.isRunning = false;
            timer.isBreak = false;
            startBtn.textContent = 'Start';
            updateTimerDisplay();
            saveState();
