  function resetTimer() {
    clearInterval(timerInterval);
    timeLeft = mode === 'focus' ? 25 * 60 : 5 * 60;
    document.getElementById('time').textContent = `${mode === 'focus' ? '25:00' : '05:00'}`;
    toggleTimer();
    switchMode();
