Evaluator feedback:
1. Pomodoro is not 25/5 with auto-switch: no 5-minute break mode, no session state, and on reaching 0 it calls `toggleTimer()` instead of switching to break/focus automatically.

2. Timer start/pause/reset behavior is incorrect: after pausing, `toggleTimer()` sets button text to Resume, but subsequent presses fall into the else branch again (since text isnt Start), so it keeps pausing and never resumes.

3. Timer can create multiple intervals: `startTimer()` doesnt clear an existing `timerInterval` before starting a new one, so repeated starts can stack intervals.

4. Timer state is not persisted to `localStorage`: `timeLeft`, running/paused state, current mode (focus/break), and any timing reference are not saved/restored.

5. Tasks are only partially persisted: only the `tasks` array is saved; selected task state and any UI state isnt persisted (requirement asks to persist timer state too).

6. Keyboard shortcut Space toggles timer is unreliable and can interfere with typing: global `keydown` triggers on Space even when focus is in the task input, and it doesnt `preventDefault()` (page scroll can occur).

7. Keyboard shortcut Delete removes selected task is broken: no `.dataset.index` is ever set on task items, so `deleteTask(...dataset.index)` passes `undefined` and can delete the wrong item (typically index 0 via splice coercion).

8. Selected task mechanism is inconsistent: clicking a task both toggles done (via per-`li` click handler) and selects it (via `tasksList` click handler), so selection and done toggle happen together unintentionally.

9. Clicking the Delete button also toggles done due to event bubbling from the button click to the `li` click handler (no `stopPropagation()`).

10. CRUD is incomplete: there is no Update/Edit task text functionality (only create, toggle done, delete).

11. Accessibility: missing visible focus styles for interactive elements (buttons, input, task items); no `:focus`/`:focus-visible` styling.

12. Accessibility: task items are plain `<li>` with click handlers but not keyboard-operable (no `tabindex`, no role/button semantics, no Enter/Space activation).

13. Accessibility: task input has only `aria-label` and placeholder; no associated `<label for="task-input">` (requirement asks for labels).

14. Accessibility: Delete buttons created in JS lack an accessible name tied to the task (all just Delete without context), and task items dont expose state (done/selected) via ARIA.

15. Timer display lacks an aria-live region; changes may not be announced to assistive tech (timer is dynamic).

16. Reset does not reset paused/running state consistently: `isPaused` isnt reset, and UI state can desync; also timer state isnt saved after reset.

17. Timer reaching 0 clears interval then calls `toggleTimer()`, which can start a new interval immediately without switching mode and without resetting `timeLeft`, causing negative time or stuck state.

18. `renderTasks()` sets `li.textContent = task.text` then appends a button; this removes any structure/semantics (no separate label/checkbox) and makes the entire row one text node plus a button, limiting accessibility and control.

