<!DOCTYPE html>
<html lang="en">
<head>
<meta charset="UTF-8">
<meta name="viewport" content="width=device-width, initial-scale=1.0">
<title>Focus Board</title>
<style>
  body { font-family: Arial, sans-serif; }
  .container { display: flex; justify-content: space-between; width: 80%; margin: auto; }
  .task-list { width: 45%; }
  .timer { width: 45%; text-align: center; }
  .task-input { width: calc(100% - 2px); padding: 5px; margin-bottom: 10px; }
  .task-item { display: flex; justify-content: space-between; align-items: center; margin-bottom: 5px; }
  .task-btn { background-color: #f44336; color: white; border: none; padding: 5px 10px; cursor: pointer; }
  .timer-btn { background-color: #2196F3; color: white; border: none; padding: 10px 20px; margin: 5px; cursor: pointer; }
</style>
</head>
<body>
<div class="container">
  <div class="task-list">
    <input type="text" id="task-input" placeholder="Add task..." aria-label="Task input">
    <button id="add-task-btn" aria-label="Add task">Add</button>
    <ul id="tasks"></ul>
    <p>Total: <span id="total-tasks">0</span>, Done: <span id="done-tasks">0</span></p>
  </div>
  <div class="timer">
    <h2>Focus Timer</h2>
    <button id="start-pause-btn" aria-label="Start/Pause timer">Start</button>
    <button id="reset-btn" aria-label="Reset timer">Reset</button>
    <p id="timer">25:00</p>
  </div>
</div>

<script>
  const taskInput = document.getElementById('task-input');
  const addTaskBtn = document.getElementById('add-task-btn');
  const tasksList = document.getElementById('tasks');
  const totalTasksSpan = document.getElementById('total-tasks');
  const doneTasksSpan = document.getElementById('done-tasks');
  const startPauseBtn = document.getElementById('start-pause-btn');
  const resetBtn = document.getElementById('reset-btn');
  const timerDisplay = document.getElementById('timer');

  let tasks = JSON.parse(localStorage.getItem('tasks')) || [];
  let timerInterval;
  let isPaused = false;
  let timeLeft = 25 * 60;

  function renderTasks() {
    tasksList.innerHTML = '';
    tasks.forEach((task, index) => {
      const li = document.createElement('li');
      li.className = task.done ? 'task-item done' : 'task-item';
      li.textContent = task.text;
      li.addEventListener('click', () => toggleTaskDone(index));
      li.appendChild(createDeleteButton(index));
      tasksList.appendChild(li);
    });
    updateTaskCounts();
  }

  function createDeleteButton(index) {
    const btn = document.createElement('button');
    btn.className = 'task-btn';
    btn.textContent = 'Delete';
    btn.addEventListener('click', () => deleteTask(index));
    return btn;
  }

  function toggleTaskDone(index) {
    tasks[index].done = !tasks[index].done;
    renderTasks();
    saveState();
  }

  function deleteTask(index) {
    tasks.splice(index, 1);
    renderTasks();
    saveState();
  }

  function updateTaskCounts() {
    totalTasksSpan.textContent = tasks.length;
    doneTasksSpan.textContent = tasks.filter(task => task.done).length;
  }

  function startTimer() {
    isPaused = false;
    timerInterval = setInterval(() => {
      if (!isPaused) {
        timeLeft--;
        const minutes = Math.floor(timeLeft / 60);
        const seconds = timeLeft % 60;
        timerDisplay.textContent = `${minutes.toString().padStart(2, '0')}:${seconds.toString().padStart(2, '0')}`;
        if (timeLeft <= 0) {
          clearInterval(timerInterval);
          toggleTimer();
        }
      }
    }, 1000);
  }

  function pauseTimer() {
    isPaused = true;
  }

  function resetTimer() {
    clearInterval(timerInterval);
    timeLeft = 25 * 60;
    timerDisplay.textContent = '25:00';
    startPauseBtn.textContent = 'Start';
  }

  function toggleTimer() {
    if (startPauseBtn.textContent === 'Start') {
      startTimer();
      startPauseBtn.textContent = 'Pause';
    } else {
      pauseTimer();
      startPauseBtn.textContent = 'Resume';
    }
  }

  function saveState() {
    localStorage.setItem('tasks', JSON.stringify(tasks));
  }

  taskInput.addEventListener('keypress', (e) => {
    if (e.key === 'Enter') addTask();
  });

  document.addEventListener('keydown', (e) => {
    if (e.key === ' ') toggleTimer();
    if (e.key === 'Delete' && tasksList.querySelector('.task-item.selected')) deleteTask(tasksList.querySelector('.task-item.selected').dataset.index);
  });

  tasksList.addEventListener('click', (e) => {
    const taskItem = e.target.closest('.task-item');
    if (taskItem) {
      tasksList.querySelectorAll('.task-item').forEach(item => item.classList.remove('selected'));
      taskItem.classList.add('selected');
    }
  });

  addTaskBtn.addEventListener('click', addTask);
  startPauseBtn.addEventListener('click', toggleTimer);
  resetBtn.addEventListener('click', resetTimer);

  function addTask() {
    const text = taskInput.value.trim();
    if (text) {
      tasks.push({ text, done: false });
      renderTasks();
      saveState();
      taskInput.value = '';
    }
  }

  renderTasks();
</script>
</body>
</html>
