1. No task creation UI (no input field/button); Enter shortcut uses `prompt()` instead of adding from an accessible input.

2. No task edit/update capability (CRUD incomplete: only add/delete; checkbox changes are not wired to update state).

3. No task counts displayed (total and done counters missing).

4. `completeTask()` is never called; checking a task checkbox does nothing.

5. Deleting via `Delete` key removes `currentTaskIndex`, not a user-selected task; there is no concept of a selected task.

6. `currentTaskIndex` is misused as both current task and deletion target; it becomes invalid after deletions and can point past the end.

7. Timer logic is broken: `updateTime()` references `time` but `time` is never defined, causing a runtime error on start.

8. Timer counts up from undefined/0 instead of a 25:00 countdown; no 25/5 Pomodoro durations implemented.

9. No auto-switch between work (25) and break (5) sessions.

10. Timer state is not fully persisted: remaining/elapsed time, current mode (work/break), and interval start timestamp arent stored; only `isRunning` is stored.

11. On reload, if `isRunning` is true it calls `startTimer()` without restoring time; also `isRunning` true will restart a broken timer (and still lacks persisted time/mode).

12. `resetTimer()` incorrectly clears all tasks and resets `currentTaskIndex`; reset should reset timer, not wipe tasks.

13. `pauseBtn.disabled` and `startBtn.disabled` toggling is inconsistent/incorrect (pause disabled only in reset and else branch; start never disabled on start; reset button state not managed coherently).

14. Space shortcut uses `e.key === ' '` without `preventDefault()`, so it will scroll the page when focused on body.

15. Enter shortcut triggers globally and can interfere with button activation and other interactive elements (no scoping; no `preventDefault()`).

16. localStorage persistence only happens on `beforeunload`; task changes and timer changes arent saved immediately (can lose state on crash/tab kill).

17. Checkbox inputs have no associated labels (`<label>`), and delete buttons are unlabeled beyond visible text (no `aria-label` where needed).

