20. Task text is injected via `innerHTML` without escaping, enabling HTML/script injection via task text.

21. Delete button click uses `dataset.index` (string) passed to `splice`; relies on implicit coercion (bug-prone).

22. `completeTask()` increments `currentTaskIndex` independently of user actions; even if wired, it wouldnt reflect checked items correctly.

23. No enforcement of no external libraries issue here (ok), but app doesnt meet other required features (Pomodoro, counts, proper shortcuts, accessibility, persistence).

